angular.module('starter.services', [])

.factory('Clinics', function() {
  // Might use a resource here that returns a JSON array

  // Some fake testing data
  var clinics = [{
    id: 0,
    name: 'Quality Medical',
    description: 'Professional Healthcare',
    treatments: ['Chicken Pox', 'Diptheria', 'HPV', 'Influenza', 'Dengue Fever'],
    logo: 'http://www.qhms.com/images/en-US/theme/logo_medical.jpg'
  }, {
    id: 1,
    name: 'Pain in the butt',
    description: 'Speedy Injections',
    treatments: ['Chicken Pox', 'Diptheria', 'HPV'],
    logo: 'data:image/jpeg;base64,'
  }, {
    id: 2,
    name: 'Ow! Ow! Medical',
    description: 'Stabby stuff done here',
    treatments: ['Diptheria', 'HPV', 'Influenza'],
    logo: 'data:image/jpeg;base64,'
  }];

  return {
    all: function() {
      return clinics;
    },
    remove: function(clinic) {
      clinics.splice(clinics.indexOf(clinic), 1);
    },
    get: function(clinicId) {
      for (var i = 0; i < clinics.length; i++) {
        if (clinics[i].id === parseInt(clinicId)) {
          return clinics[i];
        }
      }
      return null;
    }
  }
})

